css:
@-moz-document domain("powrotroberta.pl") {
.elementor-container
{
	max-width: 1300px !important;
	min-height: 28px;
}

body, section, span, p, div, .elementor *
{
	background: /**/
	url(data:image/png;base64,)/**/
	#222 !important;
	color: #ccc;
}

h1, h2, h3, h4, h5, .elementor-19811 .elementor-element.elementor-element-fe75d74 .elementor-icon-list-text, .elementor-19811 .elementor-element.elementor-element-fe75d74 .elementor-icon-list-text a, .elementor-19811 .elementor-element.elementor-element-d6fc7f3 > .elementor-element-populated
{
	color: #c83 !important;
	background-color: #cd91;
	border-color: #cb6;
	border-width: 0px 2px 0px 0px;
	/**
	padding: 5px 0px 5px 5px !important;
	/**/
}

a, i, .elementor-20303 .elementor-element.elementor-element-b0c1306 .elementor-icon-list-text, .elementor-20303 .elementor-element.elementor-element-b0c1306 .elementor-icon-list-text a
{
	color: #cb6 !important;
}

nav
{
	border: solid #cb6 1px !important;
	background-color: #222 !important;
}

div, .elementor-search-form__submit
{
	background-color: #222 !important;
	color: #cb6 !important;
}

.elementor-18594 .elementor-element.elementor-element-d9f4b72 .elementor-post, .elementor-18594 .elementor-element.elementor-element-2312f17 .elementor-post, .elementor-18594 .elementor-element.elementor-element-918c67f .elementor-post
{
	border: solid #cb64 1px !important;
}

table, tbody, tr, th, td
{
	background-color: #333 !important;
	color: #ccc !important;
}

.elementor-divider-separator
{
	border-top-color: #c83 !important;
}

span.sub-arrow, span.sub-arrow:hover, span.sub-arrow:active
{
	background-image: none !important;
}
}
